import React from "react";
import * as S from "./";
import { ReactComponent as Arrow } from "../../asset/arrowIcon.svg";

const Text = () => {
  return (
    <S.CardBox height="40px" justifyContent="space-between">
      <p>텍스트들어갈자리</p>
      <Arrow />
    </S.CardBox>
  );
};

export default Text;
